import React, { useState } from 'react';
import logo from '../assets/icons/logo.png';
import { Link } from 'react-router-dom';
import '../assets/fonts/Quicksand-Regular.ttf';
import '../assets/fonts/Poppins-Regular.ttf';

const Header = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [hoveredIndex, setHoveredIndex] = useState(-1);

  const dropdownItems = [
    { name: 'Fort Worth, TX Chapter', link: '/chapters/fort-worth' },
    { name: 'Houston, TX Chapter', link: '/chapters/houston' },
    { name: 'Little Rock, AR Chapter', link: '/chapters/little-rock' },
  ];

  return (
    <header style={styles.header}>
      {/* Logo and Title */}
      <Link to="/" style={styles.titleContainer}>
        <span style={styles.titleText}>UMMATI C</span>
        <img src={logo} alt="Logo" style={styles.logo} />
        <span style={styles.titleText}>MMUNITY</span>
      </Link>

      {/* Navigation Links */}
      <div style={styles.rightSection}>
        <nav style={styles.navLinks}>
          <Link style={styles.navItem}>Events</Link>
          <div
            style={styles.dropdown}
            onMouseEnter={() => setIsDropdownOpen(true)}
            onMouseLeave={() => setIsDropdownOpen(false)}
          >
            <Link to="/chapters" style={styles.navItem}>
              Chapters
            </Link>
            {isDropdownOpen && (
              <div style={styles.dropdownMenu}>
                {dropdownItems.map((item, index) => (
                  <div
                    key={index}
                    style={{
                      ...styles.dropdownItem,
                      backgroundColor: hoveredIndex === index ? '#78B27B' : 'white',
                    }}
                    onMouseEnter={() => setHoveredIndex(index)}
                    onMouseLeave={() => setHoveredIndex(-1)}
                  >
                    <Link to={item.link} style={styles.dropdownLink}>
                      {item.name}
                    </Link>
                  </div>
                ))}
              </div>
            )}
          </div>
          <Link to="/podcast" style={styles.navItem}>
            Podcast
          </Link>
          <Link to="/membership" style={styles.navItem}>
            Membership
          </Link>
          <Link to="/about" style={styles.navItem}>
            About
          </Link>
          <Link to="/contact" style={styles.navItem}>
            Contact
          </Link>
        </nav>

        {/* Login Button */}
        <div style={styles.loginButton}>
          <span style={styles.loginButtonText}>Login</span>
        </div>
      </div>
    </header>
  );
};

const styles = {
  header: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
    background: 'white',
    padding: '35px 40px',
    width: '100%',
    flexWrap: 'wrap',
  },
  titleContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '5px',
    flexShrink: 0,
  },
  titleText: {
    color: '#5A4283',
    fontSize: '1.75rem', // Adjusts dynamically for responsive sizing
    fontFamily: 'Quicksand',
    fontWeight: 700,
    whiteSpace: 'nowrap',
    margin: 0,
  },
  logo: {
    width: 'clamp(30px, 5vw, 50px)', // Adjusts from 30px on mobile to 50px on desktop
    height: 'clamp(30px, 5vw, 50px)',
    marginTop: '-1px',
    marginLeft: '-13px', // Adjust to fine-tune spacing between text and logo
    marginRight: '-13px',
  },
  rightSection: {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
    flexWrap: 'wrap',
    flexDirection: 'row',
  },
  navLinks: {
    display: 'flex',
    gap: '20px',
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  navItem: {
    color: '#5A4283',
    fontSize: '1.0rem',
    fontFamily: 'Quicksand',
    cursor: 'pointer',
    textAlign: 'center',
    whiteSpace: 'nowrap',
  },
  dropdown: {
    position: 'relative',
  },
  dropdownMenu: {
    position: 'absolute',
    top: '100%',
    left: 0,
    background: 'white',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    borderRadius: '8px',
    zIndex: 1000,
    padding: '10px 0',
    width: '200px', // Adjust as needed
  },
  dropdownItem: {
    padding: '12px 21px',
    borderLeft: '1px solid #ECE7DA',
    borderRight: '1px solid #ECE7DA',
    color: 'black',
    fontSize: '12px',
    fontFamily: 'Poppins',
    fontWeight: '400',
    wordWrap: 'break-word',
    transition: 'background-color 0.3s',
  },
  dropdownLink: {
    textDecoration: 'none',
    color: 'black',
    display: 'block',
  },
  loginButton: {
    padding: '8px 16px',
    backgroundColor: '#78B27B',
    borderRadius: 40,
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  loginButtonText: {
    color: '#D9F4DA',
    fontSize: '1rem',
    fontFamily: 'Quicksand',
    fontWeight: 700,
    letterSpacing: 0.32,
    whiteSpace: 'nowrap',
  },
};

export default Header;
